  false,\n\t\"url\": null,\n\t\"notes\": \"TerraPoint surveyed and created this data
  for the Puget Sound LiDAR Consortium under contract. The area surveyed is approximately
  525 square miles and covers all of Island County, WA and the Northeast portion of
  Jefferson County, WA. All data was collected during ideal conditions (leaf-off).
  The LAS files were derived from all returns ASCII files contain the X,Y,Z values
  of all the LiDAR returns collected during the survey mission. The GPS time, scan
  angle and return numbers of each point were preserved in the conversion from ASCII
  to LAS. The LAS files were classified into the following ASPRS classes: (1) Unclassified
  (2) Bare Earth. Ground and water points are included in Class 2 (Bare Earth). Futher
  details are available in the Process Steps below. No ancillary data, such as intensity,
  is available for this data. Initially this dataset was flown in 2001 with a 30%
  overlap between flight lines which did not meet specifications. The dataset was
  reflown in 2002 with a 50% overlap between flight lines as the rest of the PSLC
  data. The data is broken down into USGS quarter quads and then into 25 tiles within
  each quarter quad. Due to the overlap the nominal point spacing of the dataset is
  1.0 meter.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
